import React from 'react';
import Paginator from '../common/Paginator/Paginator';
import User from './User';



const FriendsFunc = ({ totalUsersCount, pageSize, currentPage, onPageChanged, users, ...props }) => {
    return <div>
        <Paginator totalUsersCount={totalUsersCount} pageSize={pageSize} currentPage={currentPage} onPageChanged={onPageChanged} />
        {
            users.map(u => <User user={u}  key={u.id} follow={props.followingInProgress} unFollowThunk={props.unFollowThunk} followThunk={props.followThunk}/> )      
        }
    </div>
}

export default FriendsFunc;
